Select *
from VEN.STOCKRECOMMENDATIONTABLE;

Create View WhatToBuyView as
Select STOCKSYMBOL, COUNT(STOCKSYMBOL) as count
from VEN.STOCKRECOMMENDATIONTABLE
group by STOCKSYMBOL
order by count desc;



